/*(non-Javadoc) @see org.apache.lucene.search.function.CustomScoreQuery#customScore(int, float, float) */
public float customScore(int doc, float subQueryScore, float valSrcScore) {
  return subQueryScore + valSrcScore;
}

/*(non-Javadoc) @see org.apache.lucene.search.function.CustomScoreQuery#customScore(int, float, float) */
@Override
public float customScore(int doc, float subQueryScore, float valSrcScore) {
  return subQueryScore + valSrcScore;
}

